import React from "react";
import "./App.css";

let name1 = document.getElementById("name1").nodeValue;
let mail = document.getElementById("mail").nodeValue;

function submit(name1, mail) {
  name1;
}

export default function App() {
  return (
    <div>
      <div className="container">
        <div className="brand-logo"></div>
        <div className="brand-title">TWITTER</div>
        <div className="inputs">
          <label>User Name</label>
          <input id="name1" type="text" placeholder="John" />
          <label>Email</label>
          <input id="mail" type="email" placeholder="Someone@mail.com" />
          <button type="submit" onClick="submit()">
            LOGIN
          </button>
        </div>
      </div>
    </div>
  );
}
